def do_mirstamp(timg, tdrawable, text, colour):
    if isinstance(u"", str):
        if isinstance(text, bytes):
            text = text.decode('UTF-8')
        text = str(text)
    else:
        if not isinstance(text, unicode):
            text = str(text).decode('UTF-8')
        text = unicode(text)
    # ╱╲╱╲╱╲ 96x16px R,G,B – for now…
    w = 96
    h = 16
    tl = gimp.Layer(timg, "tmp", w, h, RGBA_IMAGE, 100, NORMAL_MODE)
    tl.fill(TRANSPARENT_FILL)
    pr = tl.get_pixel_rgn(0, 0, w, h)
    if len(pr[0, 0]) != 4:
        raise Exception("number of channels (%d) unexpectedly not 4" % len(pr[0, 0]))
    fb = array("B", pr[0:w, 0:h])
    for (ofs, col) in ((0,(255,0,0)), (32,(0,255,0)), (64,(0,0,255))):
        bcol = array("B", col)
        bcol.append(0xFF)
        def draw(x, y):
            ptr = (y * w + x + ofs) * 4
            fb[ptr:ptr+4] = bcol
        draw(0, 15 - 0)
        draw(0, 15 - 1)
        draw(1, 15 - 2)
        draw(2, 15 - 2)
        draw(3, 15 - 3)
        draw(4, 15 - 4)
        draw(5, 15 - 5)
        draw(6, 15 - 6)
        draw(7, 15 - 7)
        draw(8, 15 - 8)
        draw(9, 15 - 9)
        draw(10, 15 - 10)
        draw(11, 15 - 11)
        draw(12, 15 - 12)
        draw(13, 15 - 13)
        draw(14, 15 - 14)
        draw(15, 15 - 15)
        draw(16, 15 - 15)
        draw(17, 15 - 14)
        draw(18, 15 - 13)
        draw(19, 15 - 12)
        draw(20, 15 - 11)
        draw(21, 15 - 10)
        draw(22, 15 - 9)
        draw(23, 15 - 8)
        draw(24, 15 - 7)
        draw(25, 15 - 6)
        draw(26, 15 - 5)
        draw(27, 15 - 4)
        draw(28, 15 - 3)
        draw(29, 15 - 2)
        draw(30, 15 - 1)
        draw(31, 15 - 0)
    pr[0:w, 0:h] = fb.tostring()
    tl.set_offsets(0, timg.height - h)
    timg.add_layer(tl, -1)
    timg.flatten()

